    false,nt"url": null,nt"notes": "An aerial photograph is a photograph of
    the earth's surface taken with a camera mounted in an airplane. The geographic extent
    of this scanned, georectified, and mosaiced 3.5-meter pixel resolution black and
    white digital aerial photograph is approximately the Idaho Department of Water Resources
    Administrative Basin 43. 15 tiles acquired as part of the 1968 IDWR Administrative
    Basin 43 (Raft river area) Air Photo Project are included in this mosaic. The collection
    area includes parts of Cassia county around the Raft river. The 1:20,000-scale black
    and white aerial photography used in the production of this mosaiced image was flown
    in 1968 by the Farm Service Administration.",nt"license_title": null,nt"extras":
